import "./routePage.scss"
import { Header } from "../../components/header/header"
import { useEffect, useState } from "react"
import { ProfileModal } from "../../components/profileModal/profileModal"
import array from "../../array.js"

export const RoutePage = ({
  profileModal,
  setProfileModal,
  textProfileModalActive,
  setTextProfileModalActive,
  routeUser,
}) => {
  const [routes, setRoutes] = useState([])

  const routeUserRoutePage = () => {
    const startIndex = routeUser.start
    const endIndex = routeUser.end
    const arrayLength = array.length

    // Прямой маршрут (по часовой стрелке)
    let forwardData = []
    let forwardSteps = 0
    let current = startIndex

    while (current !== endIndex) {
      forwardData.push(...array[current].slice(1))
      current = (current + 1) % arrayLength
      forwardSteps++
    }

    // Обратный маршрут (против часовой стрелки)
    let backwardData = []
    let backwardSteps = 0
    current = startIndex

    while (current !== endIndex) {
      current = (current - 1 + arrayLength) % arrayLength
      backwardData.push(...[...array[current].slice(1)].reverse()) // reverse: от end к start
      backwardSteps++
    }

    const startName = array[startIndex][0].start
    const endName = array[endIndex][0].start

    // Сравнение по количеству шагов (корпусов)
    const chosen =
      forwardSteps <= backwardSteps
        ? {
            direction: "Прямой маршрут",
            from: startName,
            to: endName,
            data: forwardData,
          }
        : {
            direction: "Обратный маршрут",
            from: endName,
            to: startName,
            data: backwardData,
          }

    return [chosen]
  }

  useEffect(() => {
    if (routeUser?.start != null && routeUser?.end != null) {
      const newRoutes = routeUserRoutePage()
      setRoutes(newRoutes)
    }
  }, [routeUser])

  const renderRouteBlocks = (route) => {
    const { data } = route
    const midpointIndex = Math.floor(data.length / 2) // Индекс для промежуточного корпуса
    const firstHalf = data.slice(0, midpointIndex)
    const secondHalf = data.slice(midpointIndex)

    return (
      <>
        {/* Заголовок отправки корпуса */}
        <div className="directionTitle">{route.direction}</div>
        <div className="fromTo">
          {route.from} → {route.to}
        </div>

        {/* Объекты от отправного корпуса до промежуточного */}
        <div className="routeBlock">
          <div className="sectionTitle">Отправка корпус</div>
          {firstHalf.map((place, index) => (
            <div className="BlockRoutePage" key={index}>
              <div className="titlePlaceRoutePage">{place.name}</div>
              <div className="textPlaceRoutePage">{place.address}</div>
              <div className="textPlaceRoutePage">{place.info}</div>
            </div>
          ))}
        </div>

        {/* Промежуточный корпус (если есть) */}
        <div className="routeBlock">
          <div className="sectionTitle">Промежуточный корпус</div>
          <div className="titlePlaceRoutePage">{data[midpointIndex]?.name}</div>
          <div className="textPlaceRoutePage">
            {data[midpointIndex]?.address}
          </div>
          <div className="textPlaceRoutePage">{data[midpointIndex]?.info}</div>
        </div>

        {/* Объекты от промежуточного корпуса до конечного */}
        <div className="routeBlock">
          <div className="sectionTitle">Прибытие корпус</div>
          {secondHalf.map((place, index) => (
            <div className="BlockRoutePage" key={index}>
              <div className="titlePlaceRoutePage">{place.name}</div>
              <div className="textPlaceRoutePage">{place.address}</div>
              <div className="textPlaceRoutePage">{place.info}</div>
            </div>
          ))}
        </div>
      </>
    )
  }

  return (
    <div className="routeePage">
      <Header setProfileModal={setProfileModal} />
      <div className="titleRoutePage">Ваш маршрут</div>
      <div className="BlockRoutePage">
        {routes.map((route, i) => (
          <div key={i}>{renderRouteBlocks(route)}</div>
        ))}
      </div>
      {profileModal && (
        <div className="profileModalRoutesPage">
          <ProfileModal
            textProfileModalActive={textProfileModalActive}
            setTextProfileModalActive={setTextProfileModalActive}
          />
        </div>
      )}
    </div>
  )
}
